import React from 'react'
import logo from '../assests/WhatsApp Image 2024-03-30 at 16.32.05.jpeg'
import { NavLink } from 'react-router-dom'

import './Navbar.css';

const Navbar = () => {
  return (
    <div className='navbar'>
        <div className='left'>
            <img src={logo} alt="" />
        </div>
        <div className='right'>
            <NavLink to="/" activeClassName="active-link" style={{ borderBottom: '2px solid white' }}>Home</NavLink>
            <NavLink to="/About" activeClassName="active-link" >About</NavLink>
            <NavLink to="/Courses" activeClassName="active-link" >Courses</NavLink>
            <NavLink to="/Contact" activeClassName="active-link">Contact</NavLink>
        </div>
    </div>
  )
}

export default Navbar;
